import React from 'react';

const Audio = () => {
    const [matchingResults, setMatchingResults] = React.useState([]);
    const [noMatch, setNoMatch] = React.useState(false);
    const [isLoading, setIsLoading] = React.useState(false);

    const sampleList = [1, 2, 3, 4, 5]; // Renamed imageList to sampleList

    const handleClick = (sampleNumber) => { // Renamed parameter from 'i' to 'sampleNumber'
        setIsLoading(true);
        setMatchingResults([]);
        setNoMatch(false);
        console.log("Sample Number:", sampleNumber); // Log the sample number
        const baseUrl = 'http://127.0.0.1:5000/analyze-audio';
        const url = `${baseUrl}/sample${sampleNumber}`; // Adjusted URL to include 'sample'
        fetch(url)
            .then(res => res.json())
            .then(res => {
                if (res.success) {
                    setMatchingResults(res.data[0]);
                } else {
                    setNoMatch(true);
                }
            })
            .finally(() => {
                setIsLoading(false);
            });
    };

    if (isLoading)
        return <div>Loading....</div>;

    return (
        <>
            <div className='flex gap-5'>
                {sampleList?.map((sample) => ( // Renamed 'item' to 'sample'
                    <div className='p-10 background-red' key={sample}
                        onClick={() => handleClick(sample)}
                    >
                        Sample {sample} {/* Added "Sample" prefix */}
                    </div>
                ))}
            </div>
            <div className='flex justify-center items-center'>
                {matchingResults && (
                    <div>
                        {matchingResults.folder_name}
                        {matchingResults.matching_percentage}
                    </div>
                )}
                {noMatch && (<div>No match </div>)} {/* Corrected typo in "No match" */}
            </div>
        </>
    );
};

export default Audio;
